import "./App.css";

import { BrowserRouter, Routes, Route } from "react-router-dom";

import SEssionExaple from "./pages/SEssionExaple";

function App() {
  return (
    <div className="App d-flex flex-column">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<SEssionExaple />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
